import React from "react";
import SearchBar from '../SearchBar/SearchBar.jsx'
import {Link} from "react-router-dom"

export default function Nav (props){
    return (
        <div>
            <Link to={("/about")}>About</Link>
            <SearchBar onSearch={props.onSearch}/>
        </div>
    )
}
